import React from 'react';
import classes from './Header.module.css';
import {NavLink} from "react-router-dom";

const Header = (props) => {
    if (!props.profile.photos) {
        props.profile.photos = ''
    }

    return (
        <header className={classes.header}>
            <img src='http://pngimg.com/uploads/vkontakte/vkontakte_PNG31.png'/>
            <div class='dropdown'>
                <button class='btn btn-info dropdown-toggle' data-toggle='dropdown'>
                    {props.isAuth
                    ? <span>{props.login}</span>
                    : <NavLink to={'/login'}>login</NavLink>}
                    <span class='caret'></span></button>
                <ul class='dropdown-menu'>
                    <li>
                        <a className='btn btn-sm' onClick={props.logout}>log out</a></li>
                </ul>
                {/*<div className={classes.login}>*/}
                {/*    {props.isAuth*/}
                {/*        ? <div><span>{props.login}</span>*/}
                {/*            <button class='btn btn-warning btn-sm' onClick={props.logout}>log out</button>*/}
                {/*        </div>*/}
                {/*        : <NavLink to={'/login'}>login</NavLink>}*/}
                {/*</div>*/}
            </div>
        </header>
    )
}

export default Header
